 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#f7931e;font-size:22px;font-family:'Montserrat';\"><B>JOY WINONA P. PERADO</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Montserrat';\">COLLEGE LIBRARIAN 2</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:16px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Montserrat';\">The library is typically divided into quiet study areas, group discussion rooms, and computer stations to accommodate various learning styles. Equipped with comfortable seating and modern facilities, it provides a conducive environment for studying, research, and intellectual exploration. Library staff are available to assist with resource searches, borrowing procedures, and other inquiries, making it an essential part of campus life. </SPAN></SPAN></DIV></div>",
